update public."Escola"
set "Ativo" = false
where "Id" in (	select ie."EscolaId" 
				from public."InscricaoEscolaridade" ie
				where ie."EscolaId" in (select "Id" from public."Escola" where "TipoCategoria" = 1));

delete from public."Escola" where "TipoCategoria" = 1 and "Ativo" = true;

